import logo from './logo.svg';
import './App.css';
import navbar from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
function App() {
  return (
    <div>
    <Router>

          <Route exact path="/navbar">
            <navbar />
          </Route>

    </Router>
    </div>
  );
}

export default App;
